  WILLIAMS, Judith Mary and MERWOOD, Robert David (cont...)
  During 1983-85 she completed a Diploma in Comprehensive Nursing at Taradale Community College. She
  worked at Waikato and Gisborne Hospitals before travelling overseas in 1987. She travelled between
  short term nursing contracts and returned to New Zealand in 1990. She completed further study and
  worked for a time as a medical representative for Lederle Laboratories.
  Rob was educated at Whangaehu, Wallingford and Punawaitai Primary Schools and St Patrick's College,
  Silverstream (1980-84). He started work with the Lands and Survey Department as a photogramatist
  then joined Colonial Mutual Life as a computer operator. After nine months living in New
  Caledonia, he returned to CML as a systems programmer. In 1991 he took a similar position with
  Comtex where he is now a computer consultant.
  In 1993 Judith and Rob went oversees again on a trip that included 72 months travelling overland
  from Cairo to Capetown. Judith now enjoys walking, tramping, tennis, cuisine and renovating their
  1910s villa.
