  b 10.03.1899 d 16.02.1973
  b 24.07.1919 d 15.09.1989
  Quentin b. and m. at Gisborne and d. at Morrinsville. Marion b. at Gisborne and d. at
  Morrinsville.
  Quentin was educated at Heretaunga School, Hastings, and Wanganui Collegiate School. He was
  a sheepfarmer and served on many local bodies. He was a rider and judge of horse events and
  a successful dog-trialist. He played tennis all his life and devoted much time to coaching.
  His other interests included gemstone jewellery, woodwork and metalwork and growing prize
  vegetables and flowers.
  01> WILLIAMS, Mary Jean m on 16.09.1967 to GALBREATH, Robin Scott
  b 11.09.1946
  b 08.12.1935 d 30.06.1989
  Mary b. at Gisborne and m. at Morrinsville. Robin, s/o George (Rob) Robertson and Dolce Elizabeth
  Spurdle, b. at Napier and d, and bd. at Te Puke. Address: 22 Gilmore Street, Te Puke.
  Mary is a kiwi fruit quality control grader and is studying extramurally at Massey University. She has
  a large collection of cactii and is active in the NZ Cactus and Succulent Society. She is also
  interested in embroidery and repertory.
